INSERT INTO `wp_posts` VALUES (1,1,'2018-02-20 13:13:52','2018-02-20 12:13:52','Witaj w WordPressie. To jest twój pierwszy wpis. Zmodyfikuj go lub usuń, a następnie rozpocznij pisanie!','Witaj, świecie!','','publish','open','open','','witaj-swiecie','','','2018-02-20 13:13:52','2018-02-20 12:13:52','',0,'http://127.0.0.1/wordpress/?p=1',0,'post','',1),(2,1,'2018-02-20 13:13:52','2018-02-20 12:13:52','To jest przykładowa strona. Strony są inne niż wpisy na blogu, ponieważ nie tylko znajdują się zawsze w jednym miejscu, ale także pojawiają się w menu witryny (w większości motywów). Większość użytkowników umieszcza na swoich witrynach stronę z informacjami o sobie, dzięki którym przedstawiają się odwiedzającym ich witrynę. Taka strona może zawierać na przykład taki tekst:\n\n<blockquote>Cześć! Za dnia jestem gońcem, a nocą próbuję swoich sił w aktorstwie. To jest moja witryna. Mieszkam w Los Angeles, mam wspaniałego psa, który wabi się Jack i lubię pi&#241;a coladę (a także spacery, gdy pada deszcz).</blockquote>\n\n... lub taki:\n\n<blockquote>Firma Wihajstry XYZ została założona w 1971 roku i od początku swojego istnienia zajmuje się produkcją najlepszych wihajstrów. W naszej siedzibie w Gotham City pracuje ponad 2000 osób, które zajmują się robieniem całej masy fantastycznych rzeczy dla mieszkańców Gotham.</blockquote>\n\nJako nowy użytkownik WordPressa powinieneś przejść do <a href=\"http://127.0.0.1/wordpress/wp-admin/\">swojego kokpitu</a>, aby usunąć tę stronę i utworzyć nowe strony z własną treścią. Baw się dobrze!','Przykładowa strona','','publish','closed','open','','przykladowa-strona','','','2018-02-20 13:13:52','2018-02-20 12:13:52','',0,'http://127.0.0.1/wordpress/?page_id=2',0,'page','',0),(4,1,'2018-03-19 14:46:19','2018-03-19 13:46:19','TEST','abcd','','publish','closed','closed','','abcd','','','2018-03-19 14:46:19','2018-03-19 13:46:19','',0,'http://127.0.0.1/wordpress/?post_type=properties&#038;p=4',0,'properties','',0),(8,1,'2018-04-19 13:21:14','2018-04-19 11:21:14','','god-of-war-2018','','inherit','open','closed','','god-of-war-2018','','','2018-04-19 13:21:14','2018-04-19 11:21:14','',0,'http://wp.seba/wp-content/uploads/2018/04/god-of-war-2018.jpg',0,'attachment','image/jpeg',0),(9,1,'2018-04-19 14:14:45','2018-04-19 12:14:45','TEST STRONY','Nieruchomości','','publish','closed','closed','','nieruchomosci','','','2018-04-19 14:14:45','2018-04-19 12:14:45','',0,'http://wp.seba/?page_id=9',0,'page','',0),(10,1,'2018-04-19 14:14:45','2018-04-19 12:14:45','TEST STRONY','Nieruchomości','','inherit','closed','closed','','9-revision-v1','','','2018-04-19 14:14:45','2018-04-19 12:14:45','',9,'http://wp.seba/2018/04/19/9-revision-v1/',0,'revision','',0),(11,1,'2018-05-17 13:09:57','0000-00-00 00:00:00','','Automatycznie zapisany szkic','','auto-draft','open','open','','','','','2018-05-17 13:09:57','0000-00-00 00:00:00','',0,'http://wp.seba/?p=11',0,'post','',0);
